function minimumOperations(num: string): number {
    let minOps = num.length; // Assume the worst case where we need to remove all digits
    const targets = ['00', '25', '50', '75'];

    for (const target of targets) {
        let ops = 0;
        let j = num.length - 1;
        for (let i = 1; i >= 0; i--) {
            while (j >= 0 && num[j] !== target[i]) {
                j--;
                ops++;
            }
            if (j >= 0) j--; // Found a matching digit, move to the next
            else break; // No match found, exit early

            if (i === 0) { // All digits in target found
                minOps = Math.min(minOps, ops);
            }
        }
    }

    return minOps === num.length ? num.length - 1 : minOps; // Handle the case when num is a single digit not in targets
}
